import{findUser} from '../store/userActions'
import { useState, useEffect } from 'react';

export function AddToGroup({participants}){

    let participantsObj = []

    useEffect(() =>{
        setParticipantsObj(participants)
    },[])

    
    async function setParticipantsObj(participant){
        try{
            let user
            participants.forEach(async function(participant){
                user = await findUser(participant)
                console.log('user',user)
                participantsObj.push(user)
            })
        }catch(err){}
    }

    console.log('aaaa',participantsObj)
    
    return <div className='participantsList'>
        {
            participantsObj.map((participant) =>{
                return <div className='participant' key={participant._id}>
                    {participant.name}
                    {participant.email}
                </div>
            })
        }
    
    </div>
}
